import React from "react";
import {Btn, ButtonsGroup} from "../../../common/form_components";

function SuggestFormControls(props) {
    return (
        <ButtonsGroup>
            <Btn variant="outlined" onClick={props.onBack}>Назад</Btn>
            <Btn variant="contained" onClick={props.onReset}>Очистить</Btn>
            <Btn variant="contained" type="submit" label="Submit">Предложить</Btn>
        </ButtonsGroup>
    )
}

export default SuggestFormControls
